ip_idname VARCHAR (50) NULL,
ip_name VARCHAR (100) NULL,
antibody_name VARCHAR (30) NOT NULL,
antibody_ref VARCHAR (30) NOT NULL,
quantity_value real NOT NULL,
quantity_unit VARCHAR (10) NOT NULL,
quantity_db real NOT NULL,
ip_flag smallint NULL,
note VARCHAR (4000) NOT NULL,
protocol_id integer NOT NULL,
operator_id integer NOT NULL,
book_ref VARCHAR (10) NOT NULL,
experiment_date date NOT NULL,
project_id integer NOT NULL,
experiment_id integer NOT NULL,
user_id integer NOT NULL,
submission_date date NOT NULL,
extract_pool_id integer NULL,
ip_experiment_id integer NOT NULL );
